import { Routes, Route } from "react-router-dom";
import Home from "./components/Home/";

function App() {
  return (
    <div className="App">
        <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/menu" element={<Menu />} />
            <Route path="/order-recap/:orderNumber" element={<Recap />} />
            <Route path="*" element={<NotFound />} />
        </Routes>
    </div>
  );

}

export default App;
